package com.rwn.rwnstudy.utilities;public class MessageGetterSetter {    private  String Date;    private String From;    private String Message;    private String Time;    private String Type;    private String image;    private String MsgId;    private String To;    private String isSeen;    public MessageGetterSetter() {    }    public MessageGetterSetter(String date, String from, String message, String time, String type, String image, String msgId, String to,String isSeen) {        Date = date;        From = from;        Message = message;        Time = time;        Type = type;        this.image = image;        MsgId = msgId;        To = to;        this.isSeen = isSeen;    }    public String getIsSeen() {        return isSeen;    }    public MessageGetterSetter setIsSeen(String isSeen) {        this.isSeen = isSeen;        return this;    }    public String getDate() {        return Date;    }    public MessageGetterSetter setDate(String date) {        Date = date;        return this;    }    public String getFrom() {        return From;    }    public MessageGetterSetter setFrom(String from) {        From = from;        return this;    }    public String getMessage() {        return Message;    }    public MessageGetterSetter setMessage(String message) {        Message = message;        return this;    }    public String getTime() {        return Time;    }    public MessageGetterSetter setTime(String time) {        Time = time;        return this;    }    public String getType() {        return Type;    }    public MessageGetterSetter setType(String type) {        Type = type;        return this;    }    public String getImage() {        return image;    }    public MessageGetterSetter setImage(String image) {        this.image = image;        return this;    }    public String getMsgId() {        return MsgId;    }    public MessageGetterSetter setMsgId(String msgId) {        MsgId = msgId;        return this;    }    public String getTo() {        return To;    }    public MessageGetterSetter setTo(String to) {        To = to;        return this;    }    @Override    public String toString() {        return "MessageGetterSetter{" +                "Date='" + Date + '\'' +                ", From='" + From + '\'' +                ", Message='" + Message + '\'' +                ", Time='" + Time + '\'' +                ", Type='" + Type + '\'' +                ", Picture='" + image + '\'' +                ", MsgId='" + MsgId + '\'' +                ", To='" + To + '\'' +                ", isSeen='" + isSeen + '\'' +                '}';    }}